	//Calculation:
	//  payload_transmit = "TESTING MESSAGE!"
	FCI_SCOPY("TESTING MESSAGE!",16, FCV_PAYLOAD_TRANSMIT,FCSZ_PAYLOAD_TRANSMIT);

	//tx_ack
	//Output: 0 -> A4
	trisa = trisa & 0xEF;
